INSERT INTO `headline_news` VALUES ('00412f72b29740b0a7199ad4b52bdb9f', '金星将与鞋扣星团上演“亲密一刻”', '据天文科普专家介绍，5月8日至10日，明亮的金星会与另疏散星团M35（又称鞋扣星团）上演“亲密一刻”，这是一次拍摄行星与深空天体相伴的机会。', 'https://fyb-2.cdn.bcebos.com/hotboard_image/53a13a91ff9f941977633563d4afc1b8', '百度', 'https://www.baidu.com/s?wd=%E9%87%91%E6%98%9F%E5%B0%86%E4%B8%8E%E9%9E%8B%E6%89%A3%E6%98%9F%E5%9B%A2%E4%B8%8A%E6%BC%94%E2%80%9C%E4%BA%B2%E5%AF%86%E4%B8%80%E5%88%BB%E2%80%9D&sa=fyb_news&rsv_dl=fyb_news', '2023-05-08 08:34:02', '2023-05-08 08:34:02', '2023-05-08 08:34:02', 2, NULL);
INSERT INTO `headline_news` VALUES ('004a9475c03e4aff8b745c826a4971a8', '委员建议在小学高年级开设历史课', '全国政协十四届一次会议3月4日开幕，全国政协委员刘显忠建议，在小学高年级开设独立的历史课程，开阔学生的视野，从小培养历史思维。', 'https://fyb-2.cdn.bcebos.com/hotboard_image/0a6516153ccf52f9f3ad24036fe2fc8b', '百度', 'https://www.baidu.com/s?wd=%E5%A7%94%E5%91%98%E5%BB%BA%E8%AE%AE%E5%9C%A8%E5%B0%8F%E5%AD%A6%E9%AB%98%E5%B9%B4%E7%BA%A7%E5%BC%80%E8%AE%BE%E5%8E%86%E5%8F%B2%E8%AF%BE&sa=fyb_news&rsv_dl=fyb_news', '2023-03-05 11:59:01', '2023-03-05 11:59:01', '2023-03-05 11:59:01', 2, NULL);
